function loadTinyMce(domId) {
    var self = $("."+domId); 
    tinymce.init({
        selector: 'textarea.'+ domId,
        readonly: window.tinymce_readonly?1:0,
        //themes: "modern",
        //skin: "lightgray",
        plugins: 'print preview paste importcss searchreplace autolink autosave save directionality code visualblocks visualchars fullscreen image link media template codesample table charmap hr pagebreak nonbreaking anchor toc insertdatetime advlist lists wordcount imagetools textpattern noneditable help charmap emoticons filery textcolor colorpicker',
        toolbar: 'undo redo | formatselect | styleselect | bold italic | alignleft aligncenter alignright alignjustify | checklist numlist | link image  | forecolor backcolor',
        filery_api_url: '/test.json',
        convert_urls: false, // Ngăn chặn tự động đổi URL
        relative_urls: false, // Bắt buộc dùng URL tuyệt đối
        remove_script_host: false,
        color_cols: 5,
        //filery_api_token: '123',
        //filery_dialog_height: '400px',
        //filery_show_images: true,
        // images_upload_url: 'https://staging.api.f6.com.vn/uploads/process',
        automatic_uploads: true,
        file_picker_types: 'file image media',
        images_upload_handler: function (blobInfo, success, failure) {
            var xhr, formData, img_path;
            xhr = new XMLHttpRequest();
            xhr.withCredentials = false;
            xhr.open('POST', window.SERVICE_UPLOAD_URL);
            xhr.setRequestHeader("Authorization", 'Bearer ' + getCookie('imap_authen_access_token'));
            xhr.setRequestHeader("channel", self.attr("data-channel"));
            xhr.setRequestHeader("type", 'image');

            xhr.onload = function() {
                if (xhr.status != 200) {
                    failure('HTTP Error: ' + xhr.status);
                    return;
                }
                let res = JSON.parse(xhr.responseText);
                img_path = res.path
                success(window.SERVICE_MEDIA_URL + img_path);
            }
            formData = new FormData();
            formData.append('files', blobInfo.blob(), blobInfo.filename());
            xhr.send(formData);
        },
        file_picker_callback: function(callback, value, meta) {
            var xhr, formData, img_path;
            var input = document.createElement('input');
            input.setAttribute('type', 'file');
            input.setAttribute('class', 'domId');
            //input.setAttribute('accept', 'image/*');           

            input.onchange = function () {
                
                xhr = new XMLHttpRequest();
                xhr.withCredentials = false;
                xhr.open('POST', window.SERVICE_UPLOAD_URL);
                xhr.setRequestHeader("Authorization", 'Bearer ' + getCookie('imap_authen_access_token'));
                xhr.setRequestHeader("channel", self.attr("data-channel"));
                xhr.setRequestHeader("type", 'file');

                xhr.onload = function() {
                    if (xhr.status != 200) {
                        console.log('HTTP Error: ' + xhr.status);
                        return;
                    }
                    let res = JSON.parse(xhr.responseText);
                    img_path = res.path
                    //success('https://st.ebomb.edu.vn' + img_path);
                    callback(window.SERVICE_MEDIA_URL + img_path);
                }

                ////// get blob //////
                var file = this.files[0];

                var reader = new FileReader();
                reader.readAsDataURL(file);
                reader.onload = function () {
                    var id = 'blobid' + (new Date()).getTime();
                    var blobCache =  tinymce.activeEditor.editorUpload.blobCache;
                    var base64 = reader.result.split(',')[1];
                    var blobInfo = blobCache.create(id, file, base64);
                    formData = new FormData();
                    formData.append('files', blobInfo.blob(), blobInfo.filename());
                    xhr.send(formData);
                };
                
            };

            input.click();                 
            
        }
    });
}
